`,paraId:731},{value:"\u5728\u4E0A\u8FF0\u4EE3\u7801\u4E2D\uFF0C\u5FAA\u73AF\u4F53\u5185\u7684 console.log \u8BED\u53E5\u662F\u4E0D\u53EF\u8FBE\u7684\uFF0C\u56E0\u4E3A\u524D\u9762\u6709\u4E00\u4E2A\u76F4\u63A5\u7684 break \u8BED\u53E5\u5BFC\u81F4\u5FAA\u73AF\u63D0\u524D\u9000\u51FA\u3002\u8FD9\u6837\u7684\u5199\u6CD5\u4F1A\u5BFC\u81F4\u8FED\u4EE3\u53EA\u6267\u884C\u4E00\u6B21\uFF0C\u5FAA\u73AF\u4F53\u5185\u7684\u4EE3\u7801\u6CA1\u6709\u88AB\u6267\u884C\u3002",paraId:732},{value:`
