const editHooks = useEdit();

function onAddBtnClick(data) {
  editHooks.showAddModal(data);
}

async function onSubmit() {
  const success = await editHooks.submit();
  if (success) {
    editHooks.hideAddModal();
    listHooks.reFlesh();
    message.success('\u65B0\u589E\u6210\u529F');
  } else {
    message.error('\u65B0\u589E\u5931\u8D25');
  }
}

return {
  onAddBtnClick,
  onSubmit,
  listHooks,
  editHooks,
};
