export async function del(params: IApi) {
  const res = await request<PageResponse<IApi>>('/category/api/delete', {
    method: 'get',
    params,
    // \u662F\u5426\u8C03\u7528\u6A21\u62DF\u63A5\u53E3\uFF0Ctrue \u8C03\u7528\u6A21\u62DF\u63A5\u53E3\uFF0C\u5426\u5219\u8C03\u7528\u5B9E\u9645\u7684\u540E\u7AEF\u63A5\u53E3
    mock: true,
  });

  if (!res?.success) message.error(res?.errorMsg);
  return res;
}
